import axios from 'axios';

export function getPokemons(){
    return async function(dispatch){
        var json = await axios.get("http://localhost:3001/pokemons", {});  //Ac치 es donde sucede toda la conexi칩n entre el Front y el Back.
        return dispatch({
            type: 'GET_POKEMONS',
            payload: json.data
        })
    }
}
